import React, {Component} from 'react';
import{HashRouter, Route, Switch } from 'react-router-dom';
import Home from '../Home/home'

class App extends Component {
  render() {
  return (
      <HashRouter>
        <Navigation/>
        <Switch>
      <Route exact path="/" component={Home}/>
        </Switch>


      </HashRouter>
  )
  }


}

export default App;
